import React from "react";
import "./styles/home.css";
import { Route } from "react-router-dom";
import Home from "./Home";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faInstagram, faLinkedin } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { Button } from "@material-ui/core";

function App() {
  return (
    <div>
      <nav>
        <header>
          <div id="siteTitle">Bessie Bauman</div>
          <span class="home-desc"> Yale College 2021 | B.A. Economics</span>
        </header>
      </nav>
      <Route path="/" component={Home} />
      <footer>
        <div class="icon-bar">
          <Button href="https://instagram.com/bessiemb" class="fa-insta">
            <FontAwesomeIcon icon={faInstagram} />
          </Button>
          <Button
            href="https://linkedin.com/in/bessiebauman35"
            class="fa-linkedin"
          >
            <FontAwesomeIcon
              icon={faLinkedin}
              style={{ verticalAlign: "bottom" }}
            />
          </Button>
          <a href="mailto:bessie.bauman@gmail.com" class="fa-google">
            <FontAwesomeIcon icon={faEnvelope} />
          </a>
        </div>
        <p>
          <strong>
            Â© 2020 Bessie Bauman | Website Inspired By{" "}
            <a href="https://www.danielzhao.com"> Daniel Zhao</a>
          </strong>
        </p>
      </footer>
    </div>
  );
}

export default App;
